// export default Movies;


class Movies extends React.Component {
    constructor(props){
        super(props);
        this.state = {
            color: "red",
            model: "3",
            brand: "mazda",
            year: 1995
        };
    }
    changeColor = () => {
        this.setState({color: "blue"});
    }

    render(){
        return (<div>
                    <h2>I am a {this.state.color} Car!</h2>
                    <button onClick={this.changeColor}>change color</button>

                </div>)
    }
}

export default Movies;
